  log_correcao	INTEGER(100) UNSIGNED DEFAULT NULL,
  log_tipo_problema INTEGER(10) DEFAULT 0,
  log_horas DECIMAL(20,5) UNSIGNED DEFAULT 0,
  log_descricao MEDIUMTEXT,
